import React from "react";
import { Button } from "@mui/material";
import "./Button.css";
const MyButton = () => {
  return (
    <div className="myBtn">
      <Button
        variant="contained"
        style={{
          borderRadius: 35,
          backgroundColor: "#228B22",
          boxShadow: "2px",
          maxWidth: "7000px",
          maxHeight: "50px",
          minWidth: "500px",
          minHeight: "30px",
        }}
      >
        Start
      </Button>
    </div>
  );
};

export default MyButton;
